import React from "react";
import styled from "styled-components";
import theme from "../../../Logic/theme";

const { primary, secondary, tri, quad, background, primaryColor } = theme;

const Container = styled.div`
  width: 95%;
  margin: 0 auto;
`;

const Spells = ({ spells }) => {
  const renderedItems = spells.map((spells) => {
    return (
      <React.Fragment key={`${spells.name} fragment`}>
        <p key={spells.name}>{spells.name}</p>
        <hr key={`${spells.name} hr`} />
      </React.Fragment>
    );
  });

  return <Container>{renderedItems}</Container>;
};

export default Spells;
